    static Dictionary<string, string> AggiungiValoriMancanti(Dictionary<string, string> dizionarioA, Dictionary<string, string> dizionarioB)
    {
        foreach (var coppiaB in dizionarioB)
        {
            if (!dizionarioA.ContainsKey(coppiaB.Key))
            {
                dizionarioA.Add(coppiaB.Key, coppiaB.Value);
            }
        }

        return dizionarioA;
    }

    static Dictionary<string, string> Mancanti(Dictionary<string, string> dizionarioA, Dictionary<string, string> dizionarioB)
    {
        Dictionary<string, string> CollectionMiss = new Dictionary<string, string>();

        foreach (var coppiaA in dizionarioA)
        {
            if (!dizionarioB.ContainsKey(coppiaA.Key))
            {
                CollectionMiss.Add(coppiaA.Key, coppiaA.Value);
            }
        }

        return CollectionMiss;
    }
